import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Navbar.css';
import logo from '../../assets/LOGO.png';

const Navbar = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const checkAuthentication = () => {
      const token = localStorage.getItem('token');
      setIsAuthenticated(!!token);
    };

    checkAuthentication();
    window.addEventListener('storage', checkAuthentication);

    return () => {
      window.removeEventListener('storage', checkAuthentication);
    };
  }, []);

  const signOut = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    setIsAuthenticated(false);
    navigate('/login');
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <Link to="/" className="navbar-logo">
          <img src={logo} alt="Voyaige Logo" />
          <span>Voyaige</span>
        </Link>
        <ul className="navbar-menu">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/tours">Tours</Link></li>
          <li><Link to="/hotels">Hotels</Link></li>
          <li><Link to="/eat-and-drink">Eat & Drink</Link></li>
          <li><Link to="/adventure">Adventure</Link></li>
          <li><Link to="/pages">Pages</Link></li>
          <li><Link to="/extra">Extra</Link></li>
        </ul>
        <div className="navbar-actions">
          <Link to="/cart" className="cart-icon">
            <i className="fas fa-shopping-cart"></i>
            <span className="cart-count">4</span>
          </Link>
          {isAuthenticated ? (
            <button onClick={signOut} className="auth-button">Log Out</button>
          ) : (
            <Link to="/login" className="auth-button">Sign In</Link>
          )}
          <Link to="/favorites" className="favorites-icon">
            <i className="fas fa-heart"></i>
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
